import axios from 'axios';

export const fetchData = (query) => {
    axios.get(`https://api.github.com/search/repositories?q=${query}`)
      .then(response => {
        console.log('response', response);
      })
      .catch(error => {
        console.log('Error fetching and parsing data', error);
      });
}
